import locale
from cores import *
from base import *
from models import Comics
from converte import convert_to_bytes
from twilio.rest import Client


what = b''
ftopdf = b''
vdown = b''
clock = b''
rflexao = b''
rgistro = b''
cfig = b''
sair = b''


def main():
    title = 'Menu Inicial'
    layout =[
        # [Sg.Titlebar(title, Sg.CUSTOM_TITLEBAR_ICON)],
        [
            Sg.Btn('', image_data=convert_to_bytes(ftopdf, (60, 60)), key='1', pad=(0, 0)),
            Sg.Btn('', image_data=convert_to_bytes(vdown, (60, 60)), key='2', pad=(0, 0)),
            Sg.Btn('', image_data=convert_to_bytes(clock, (60, 60)), key='3', pad=(0, 0)),
            Sg.Btn('', image_data=convert_to_bytes('icones/climatempo.png', (60, 60)), key='7', pad=(0, 0)),
            Sg.Btn('', image_data=convert_to_bytes(rgistro, (60, 60)), key='4', pad=(0, 0)),
            Sg.Btn('', image_data=convert_to_bytes(rflexao, (60, 60)), key='5', pad=(0, 0)),
            Sg.Btn('', image_data=convert_to_bytes(cfig, (60, 60)), key='6', pad=(0, 0)),
            Sg.Btn('', image_data=convert_to_bytes(what, (60, 60)), key='8', pad=(0, 0)),
            Sg.Btn('', image_data=convert_to_bytes(sair, (60, 60)), key='sair', pad=(0, 0))
        ]
    ]
    return Sg.Window('Projeto', layout, keep_on_top=True, finalize=True, location=(0, 773))


janela, janela_foto, janela_video, janela_relogio, janela_registro, janela_reflexao, janela_conf, janela_clima, janela_whatsapp = main(), None, None, None, None, None, None, None, None


while True:
    windows, event, values = Sg.read_all_windows(timeout=1000)

    if event == Sg.WIN_CLOSED or event == 'sair':
        windows.close()
        if windows == janela:
            break
        elif windows == janela_relogio:
            janela_relogio = None
        elif windows == janela_foto:
            janela_foto = None
        elif windows == janela_video:
            janela_video = None
        elif windows == janela_registro:
            janela_registro = None
        elif windows == janela_reflexao:
            janela_reflexao = None
        elif windows == janela_conf:
            janela_conf = None
        elif windows == janela_clima:
            janela_clima = None
        elif windows == janela_whatsapp:
            janela_whatsapp = None

    elif event == '1':
        if not janela_foto:
            janela_foto = foto_to_pdf()

    elif event == '2':
        if not janela_video:
            janela_video = video_download()

    elif event == '3':
        if not janela_relogio:
            janela_relogio = relogio()

    elif event == '4':
        if not janela_registro:
            janela_registro = registro()

    elif event == '5':
        if not janela_reflexao:
            janela_reflexao = reflexao()

    elif event == '6':
        if not janela_conf:
            janela_conf = save_config()

    elif event == '7':
            if not janela_clima:
                janela_clima = clima()

    elif event == '8' and not janela_whatsapp:
        janela_whatsapp = whatsapp()

    elif event == 'baixar_video':

        janela_video['baixar_video'].update(disabled=True)
        janela_video.perform_long_operation(lambda: download_videos(janela_video, values['url-site']), 'Video')

    elif event == 'baixar_revista':
        # chamada(janela_foto, values['url-site'], int(values['n_pag']))
        if values['url-site']:
            janela_foto.perform_long_operation(lambda: chamada(janela_foto, values['url-site'], int(values['n_pag'])),
                                                'Comics')
        else:
            Sg.popup('A Url no pode esta vazio!!!')

    elif event == 'Enviar':
        account_sid = os.environ['TWILIO_ACCOUNT_SID']
        auth_token = os.environ['TWILIO_AUTH_TOKEN']
        client = Client(account_sid, auth_token)
        message = client.messages.create(
            from_='whatsapp:+14155238886',
            body=f'{values["-Mensagem-"]}',
            to=f'whatsapp:+55{values["-Number-"]}'
        )


    elif event == 'save_db':
        Comics.create(
            site_name=values['lsite'],
            seletor_link=values['lurl1'],
            seletor_img_1=values['limg1'],
            seletor_img_2=values['limg2']
        )
        janela_conf['lsite'].update('')
        janela_conf['lurl1'].update('')
        janela_conf['limg1'].update('')
        janela_conf['limg2'].update('')
        Sg.Popup('Cadastro realizado', auto_close=True)

    elif janela_registro:
        v_base = []
        try:
            with open('historico.csv') as csvfile:
                for x in csv.reader(csvfile):
                    if x:
                        v_base.append(x)
            janela_registro['-TABLE-'].Update(values=v_base)
        except FileNotFoundError:
            pass
    elif event.startswith('-TABLE-'):
        print(values['-TABLE-'][0])

    elif janela_clima:
        title, temp, sen_ter, nascer, morrer, max_min, vento, umid, p_orv, pressao, uv, visib, f_lua = clima_tempo()
        janela_clima['clima'].update(title)
        janela_clima['temp'].update(temp)
        janela_clima['sens'].update(sen_ter)
        janela_clima['nasce'].update(nascer)
        janela_clima['morre'].update(morrer)
        janela_clima['maxmin'].update(max_min)
        janela_clima['vento'].update(vento)
        janela_clima['umidade'].update(umid)
        janela_clima['p_orv'].update(p_orv)
        janela_clima['pressao'].update(pressao)
        janela_clima['uv'].update(uv)
        janela_clima['visib'].update(visib)
        janela_clima['f_lua'].update(f_lua)


    elif event == 'Download':
        if values['t_frase'] == '':
            print('Campo Tema da Frase no pode esta vazio')
        else:
            janela_reflexao.perform_long_operation(lambda: frase_de_reflexao(janela_reflexao, values['t_frase']), 'Reflexo')
            janela_reflexao['Download'].update(disabled=True)
            janela_reflexao['complete'].update('')
    elif event.startswith('list_tema'):
        janela_reflexao['t_frase'].update(values['list_tema'])

    elif event == 'Reflexo':
        t, p = pegarfrase()
        janela_reflexao['tt_frase'].update(t)
        janela_reflexao['frase'].update(p)

    if janela_relogio:
        now = datetime.datetime.now()
        try:
            locale.setlocale(locale.LC_ALL, 'pt_BR')
        except:
            locale.setlocale(locale.LC_ALL, 'Portuguese_Brazil')
        horas = now.strftime("%X")
        data = now.strftime('%A, %d de %B de %Y')
        janela_relogio['horas'].update(horas)
        janela_relogio['data'].update(data)


janela.close()
